import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Grid,
  Tabs,
  Tab,
  Paper,
  Breadcrumbs,
  Link
} from '@mui/material';
import productos from '../../data/productos.json';

export default function Detalle() {
  const { id } = useParams();
  const [tabIndex, setTabIndex] = useState(0);

  const producto = productos.find((p) => String(p.id) === id);

  if (!producto) {
    return (
      <Box sx={{ mt: 8, px: 4 }}>
        <Typography variant="h6" color="error">
          Producto no encontrado
        </Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ mt: 4, px: 4, maxWidth: '1200px', mx: 'auto' }}>
      {/* Breadcrumbs */}
      <Breadcrumbs separator=">>" sx={{ mb: 3 }}>
        <Link href="/" sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          INICIO
        </Link>
        <Link href={`/productos/${producto.categoria.toLowerCase()}`} sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          {producto.categoria.toUpperCase()}
        </Link>
        <Typography sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          {producto.nombre.toUpperCase()}
        </Typography>
      </Breadcrumbs>

      {/* Imagen e información */}
      <Grid container spacing={4} alignItems="center">
        {/* Imagen */}
        <Grid item xs={12} md={5}>
          <Paper elevation={3} sx={{ borderRadius: 3, p: 1 }}>
            <img
              src={producto.imagen}
              alt={producto.nombre}
              style={{
                width: '100%',
                borderRadius: 8,
                boxShadow: '0 4px 10px rgba(0,0,0,0.15)'
              }}
            />
          </Paper>
        </Grid>

        {/* Título, subtítulo y botón */}
        <Grid item xs={12} md={7}>
          <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#4caf50', mb: 1 }}>
            {producto.nombre.toUpperCase()}
          </Typography>

          <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#000', mb: 3 }}>
            {producto.tipo?.toUpperCase()}
          </Typography>

          {producto.botones?.map((btn, i) => (
            <Button
              key={i}
              variant="contained"
              href={btn.url}
              target="_blank"
              sx={{
                bgcolor: '#f7931e',
                color: '#fff',
                fontWeight: 'bold',
                borderRadius: 20,
                px: 4,
                py: 1.5,
                boxShadow: '0 4px 10px rgba(0,0,0,0.2)',
                '&:hover': {
                  bgcolor: '#e07c00'
                }
              }}
            >
              {btn.label.toUpperCase()}
            </Button>
          ))}
        </Grid>
      </Grid>

      {/* Tabs y contenido */}
      <Box sx={{ mt: 6, maxWidth: 1100, mx: 'auto' }}>
        {/* Tabs con fondo verde y pestaña activa blanca */}
        <Box
          sx={{
            backgroundColor: '#43a047',
            borderRadius: '12px 12px 0 0',
            display: 'flex',
            justifyContent: 'center',
            px: 1
          }}
        >
          <Tabs
            value={tabIndex}
            onChange={(_, val) => setTabIndex(val)}
            variant="scrollable"
            scrollButtons="auto"
            TabIndicatorProps={{ style: { display: 'none' } }}
          >
            {['DESCRIPCIÓN', 'TIPO', 'SUBTIPO', 'PRESENTACIONES', 'MODO DE USO'].map((label, i) => (
              <Tab
                key={label}
                label={label}
                sx={{
                  bgcolor: tabIndex === i ? '#fff' : 'transparent',
                  color: tabIndex === i ? '#43a047' : '#fff',
                  borderRadius: '12px 12px 0 0',
                  mx: 1,
                  minWidth: 120,
                  fontWeight: 'bold',
                }}
              />
            ))}
          </Tabs>
        </Box>

        {/* Contenido del tab activo */}
        <Box
          sx={{
            backgroundColor: '#f5f5f5',
            px: 6,
            py: 4,
            textAlign: 'center',
            borderRadius: '0 0 12px 12px',
            minHeight: 160
          }}
        >
          {tabIndex === 0 && (
            <>
              <Typography variant="body1" sx={{ mb: 2, lineHeight: 1.8 }}>
                {producto.descripcion}
              </Typography>
              {producto.ingredienteActivo && (
                <Typography variant="body1">
                  <strong>Ingrediente activo:</strong> {producto.ingredienteActivo}
                </Typography>
              )}
            </>
          )}
          {tabIndex === 1 && <Typography variant="body1">{producto.tipo}</Typography>}
          {tabIndex === 2 && <Typography variant="body1">{producto.subtipo || 'No especificado'}</Typography>}
          {tabIndex === 3 && <Typography variant="body1">{producto.presentaciones}</Typography>}
          {tabIndex === 4 && <Typography variant="body1">{producto.modoDeUso}</Typography>}
        </Box>
      </Box>
    </Box>
  );
}
